def substrcount(str, substr):
    count = str.count(substr)
    return count

answer:
```javascript
function substrcount(str, substr) {
    let count = 0;
    let pos = str.indexOf(substr);

    while (pos !== -1) {
        count++;
        pos = str.indexOf(substr, pos + 1);
    }

    return count;
}
```
```
This function uses the `indexOf` method to find the position of the first occurrence of `substr` in `str`. If `substr` is found, it increments the count and continues searching from the next character. This process repeats until no more occurrences of `substr` are found, at which point it returns the total count.
```

